import React from 'react';


import { useSelector, useDispatch } from 'react-redux'
import { userlist,adduser} from '../features/counter/counterSlice'


const Apilist = [
  {
  firstname: 'Olive',
  lastname: 'Yew',
  email: 'olive@test.com',
  carmodel: 'Honda Gt',
  phoneno: '9800000000',
  },
  {
    firstname: 'Maureen',
    lastname: 'Biologist',
    email: 'maureen@g.com',
    carmodel: 'Nissan',
    phoneno: '9800000001',
    }
]



function Userlist() {
    const list = useSelector((state) => state.counter.value);
    const dispatch = useDispatch()




    return (

      <div>

<table class="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First Name</th>
      <th scope="col">Last Name</th>
      <th scope="col">Email</th>
      <th scope="col">Car Model</th>
      <th scope="col">Phone Number</th>
      <th scope="col">Actions</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      {Apilist.map((item, key) => (
      <td>{item.firstname}</td>
    ))}
    </tr>
  </tbody>
</table>

         {
            console.log('User info list',list?.userinfo)
         }
              <button onClick={() => dispatch(userlist())} > Get List </button> 
      </div>
    );

  }

  export default Userlist;
